import React from "react";

const MainIndexQuickLinkContainer = ({ children }) => {
  return (
    <div className="container">
      <nav className="nav nav-pills quick nav-justified">{children}</nav>
    </div>
  );
};

export default MainIndexQuickLinkContainer;
